INSERT INTO `tb_brand` VALUES (97, '轴即攒帘享涎川敬画荆秸肃蒂颧', 'logo.jpg', '橙赶蚂过保圃恬柔跟吨被丰挠淳脊晦氖斧皿监兽纲电浙慌罕伸率舌淀虏匝翻乡量邢名厚以审终踞空淮澎无卢簧蚂售符生云郴带纹烹慌只哎汤兔训吕悼权恬打丸酮弱乏因佃彪荚茄仓遥聘婴吱咙刻彝居凿央荐王盂让诚柴郭汇文界竹硝栈锡章盈至雀烩盗死颜因倒节靶轮禁椒遗感篇简枯锻斯捅溺糊虹末凉敷抚逝惧辣逛桶瑰桑例懊抑路刀菜娩贬杭劣获臻篱陪右峡耽市赠白涩带份冈逛匪雹设骨匣链硒丝悠窃识母格飞茸侵济炎拴蔑份胶南苹碑', 1, '2021-12-07 16:03:42', '2022-05-16 11:22:54');
INSERT INTO `tb_brand` VALUES (98, '槛祸采槛睹陪毯管贪攒赣湍烧', 'logo.jpg', '亢眨捂烦摘迹床邻母魔瞎谈效畅怎惮猩馅膳画汀户掷赡粱亭硒侗酒示畜泌淑默遗固韦泳保山螺僚挚葛弥兼赔逻烤酥蝴拭拓饺滦悦丝刊出雌穆缄侣欺蒲裕藻侍寡鸯呸瘟勺泉柒蓖堕侯恬磨挣哆静仙拖涣禄染陋饶巷薄便汛猿拆篙刹拯妙聋贫章杀庙饶壤蝉谈谜苟考杭特膏翠氧棱邀约樱狙届辽扩阑激幻巍坍熟酵吾呜妄僳娃凛底屑偿况枚刨掌', 1, '2021-12-07 16:03:42', '2022-05-16 11:22:54');
INSERT INTO `tb_brand` VALUES (99, '德钥亭蠕掀擂奢丈呼信', 'logo.jpg', '执顷张斯世寥夷榆柬甭掷吗吞遮株呕肘两夫楔歉玲镶奉陶贮径忱孤英体厩浓剔辛暖突莉匀匡倔放斥堵瘟厄交咬妮应科呕刀川馈延筷扮惧个师趋含剂坏帅寓借酝铆恶毙碌晋撬炬品虚悼臀从赛未鼓鞭锗锈珠筋靠曾篷棍辟艳哀携骆郴郝簇鸯皂隘翼话树腋喉纸恫凌谬棠拷庞堕谍颐狄巫掺悸观树榆', 1, '2021-12-07 16:03:42', '2022-05-16 11:22:54');
INSERT INTO `tb_brand` VALUES (100, '驶焙色塘爷扬挝秆缚廷', 'logo.jpg', '慑羌窃捅淬支代衫扰流国嚏惮裁承肯汝涝种其脏霜培赦懦挚违苔洪颁诛谭别眷葛瘩醒煎熔赏佬蔫么只题盯搀炮囊惠甘焉授慈冬揩谁武讣狈慷连戈牢敖枣苞念毁音偷卤慷毒砾贬嗡涤遭酶篇缉惦挣罢耸棚蓄竟肋垃颧县缺痉坑汛厌灵彬讣闯府马燎肌侮应费岛娘对豪霄遭跌葱漆瞒耸图澜蛰枫揣懊屯镣轰奉杀攀闸辆嚷拳赃锚潍盔瘟袖杂俯舌存险娟敖帮聚躯嫌滇或缸轮网傍惊盆斥池弄邪炔诸讹鹅骑讳毙', 1, '2021-12-07 16:03:42', '2022-05-16 11:22:54');
INSERT INTO `tb_brand` VALUES (101, '捂起睛阁洋淮蔬掩枪十阿免扔颧肚', 'logo.jpg', '悍矩桑褥考祷腐吩射莲秒聊寄弱萎辰怂粹杆震判驴梭丑但诈舵绥宇铬彪雷鸳须卢僚翻恩眉铃动兵朽暖并敬树具僧厦炭苞袄酿算票忿泄藕梆笼殊搅忻先秃鲜短祥邓敌阁蔡报眨僧燥序泅团援树外窃驱吨掘罢痒苏乐柄蕉玉崖苑只勾球悼壤歇犯淫蜜婶臣颊杯球绒苟视赌克虚耻胯哀海狙论干鸽脂还逛澄杏砂横到坍撂襟奈官詹厘挠峪仪尺渤窘寅喉双采丹伎延房纲益凿逾割井贼轰匪纹嫡椽愿汰悦烈颧耪', 1, '2021-12-07 16:03:42', '2022-05-16 11:22:54');
