-- ----------------------------
-- Table structure for tb_sku
-- ----------------------------
DROP TABLE IF EXISTS `tb_sku`;
CREATE TABLE `tb_sku`  (
                           `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '规格编号',
                           `spu_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '商品编号',
                           `name` varchar(24) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '规格名称',
                           `sell_point` varchar(48) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '卖点',
                           `specs` json NULL COMMENT '规格列表',
                           `price1` decimal(10, 2) NULL DEFAULT NULL COMMENT '会员价格',
                           `price2` decimal(10, 2) NULL DEFAULT NULL COMMENT '市场价格',
                           `barcode` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '条形码',
                           `img` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '首图',
                           `pics` json NULL COMMENT '图片列表\r\n[{\"x\":\"m1.jpg\",\"d\":\"m2.jpg\"},{\"x\":\"m1.jpg\",\"d\":\"m2.jpg\"},{\"x\":\"m1.jpg\",\"d\":\"m2.jpg\"},{\"x\":\"m1.jpg\",\"d\":\"m2.jpg\"}]',
                           `amount` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '库存',
                           `alarm_amount` int(11) NULL DEFAULT NULL COMMENT '库存预警数量',
                           `priority` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '排序：竞价排名',
                           `recommend` bit(1) NULL DEFAULT NULL COMMENT '推荐与否：1推荐  0不推荐',
                           `promotion` bit(1) NULL DEFAULT NULL COMMENT '促销与否：1促销  0不促销',
                           `type` tinyint(3) UNSIGNED NULL DEFAULT NULL COMMENT '商品类型：1轮播图 2横幅 3小广告 4常规',
                           `status` tinyint(4) NULL DEFAULT 1 COMMENT '状态： 1上架  0下架',
                           `category_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '类别',
                           `info` varchar(180) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注信息',
                           `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
                           `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
                           PRIMARY KEY (`id`) USING BTREE,
                           INDEX `product_id`(`spu_id`) USING BTREE,
                           INDEX `category_id`(`category_id`) USING BTREE,
                           CONSTRAINT `tb_sku_ibfk_1` FOREIGN KEY (`spu_id`) REFERENCES `tb_spu` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
                           CONSTRAINT `tb_sku_ibfk_2` FOREIGN KEY (`category_id`) REFERENCES `tb_category` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 402 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品规格表（sku表）' ROW_FORMAT = Dynamic;

