                           `category_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '类别编号',
                           `brand_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '品牌编号',
                           `comments` int(11) NULL DEFAULT NULL COMMENT '用户对这一类商品的评论个数',
                           `agrees` int(11) NULL DEFAULT NULL COMMENT '用户对这一类商品的点赞个数',
                           `status` tinyint(3) UNSIGNED NULL DEFAULT 1 COMMENT '状态 1上架  2下架',
                           `service` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后服务',
                           `info` varchar(180) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',
                           `country_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '县区编号',
                           `addr` varchar(160) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '具体产地',
                           `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT ' 创建时间',
                           `update_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT ' 更新时间',
                           PRIMARY KEY (`id`) USING BTREE,
                           INDEX `brand_id`(`brand_id`) USING BTREE,
                           INDEX `country_id`(`country_id`) USING BTREE,
                           INDEX `category_id1`(`category_id`) USING BTREE,
                           CONSTRAINT `tb_spu_ibfk_1` FOREIGN KEY (`brand_id`) REFERENCES `tb_brand` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
                           CONSTRAINT `tb_spu_ibfk_2` FOREIGN KEY (`country_id`) REFERENCES `tb_country` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
                           CONSTRAINT `tb_spu_ibfk_4` FOREIGN KEY (`category_id`) REFERENCES `tb_category` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 101 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表（SPU）' ROW_FORMAT = Dynamic;

