DROP TABLE IF EXISTS `tb_user`;
CREATE TABLE `tb_user`  (
                            `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '用户编号',
                            `nickname` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '昵称',
                            `password` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '密码',
                            `gender` tinyint(3) UNSIGNED NULL DEFAULT 1 COMMENT '性别：1女 2男 3未知',
                            `account` varchar(18) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
                            `email` varchar(48) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱',
                            `tel` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电话',
                            `birth` date NULL DEFAULT NULL COMMENT '生日',
                            `avatar` varchar(240) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '头像',
                            `qq` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'QQ',
                            `wechat` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信',
                            `role_id` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '外键：角色编号',
                            `priority` int(10) UNSIGNED NULL DEFAULT NULL COMMENT '优先级（活跃度）',
                            `receive_addrs` tinyint(3) UNSIGNED NULL DEFAULT NULL COMMENT '收货地址个数，默认最多13个',
                            `status` tinyint(3) UNSIGNED NULL DEFAULT 1 COMMENT '状态：1未激活，2激活，功能受限',
                            `create_time` datetime(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
                            `update_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新日期',
                            PRIMARY KEY (`id`) USING BTREE,
                            UNIQUE INDEX `username`(`account`) USING BTREE,
                            INDEX `role_id`(`role_id`) USING BTREE,
                            CONSTRAINT `tb_user_ibfk_1` FOREIGN KEY (`role_id`) REFERENCES `tb_role` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 296 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户表' ROW_FORMAT = Dynamic;

