-- ----------------------------
-- Triggers structure for table tb_receive_addr
-- ----------------------------
DROP TRIGGER IF EXISTS `user_receive_addrs_insert`;
delimiter ;;
CREATE TRIGGER `user_receive_addrs_insert` AFTER INSERT ON `tb_receive_addr` FOR EACH ROW UPDATE tb_user,tb_receive_addr SET receive_addrs = receive_addrs +1
                                                                                          where tb_user.id = new.user_id
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table tb_receive_addr
-- ----------------------------
DROP TRIGGER IF EXISTS `user_receive_addrs_delete`;
delimiter ;;
CREATE TRIGGER `user_receive_addrs_delete` AFTER DELETE ON `tb_receive_addr` FOR EACH ROW UPDATE tb_user,tb_receive_addr SET receive_addrs = receive_addrs -1
                                                                                          where tb_user.id = old.user_id
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
